syntax = 'proto3';
package com.practice;

option java_outer_classname = "TwitterJsonMessage";
message Twitter {
 string account_id=1;
  string created_at=2;
  string currency=3;
  int64 daily_budget_amount_local_micro=4;
  bool deleted=5;
  string duration_in_days=6;
  string end_time=7;
  string entity_status=8;
  string extra_field=9;
  string extra_field2=10;
  string extra_field3=11;
  string extra_field4=12;
  string frequency_cap=13;
  string funding_instrument_id=14;
  string id=15;
  string name=16;
  string purchase_order_number=17;
 repeated string reasons_not_servable=18;
  bool servable=19;
  string snap_time=20;
  bool standard_delivery=21;
  string start_time=22;
  int64 total_budget_amount_local_micro=23;
  string updated_at=24;
 }
